import React from 'react';

interface OutputLayerProps {
    outputShape: number[];
    activationFunction: string;
}

const OutputLayer: React.FC<OutputLayerProps> = ({ outputShape, activationFunction }) => {
    return (
        <div className="output-layer">
            <h3>Output Layer</h3>
            <p>Output Shape: {outputShape.join(', ')}</p>
            <p>Activation Function: {activationFunction}</p>
        </div>
    );
};

export default OutputLayer;
